sys_variable_value.value:
(function execute(inputs, outputs) {

  var id = inputs.set
  var name = inputs.name;
  name = name.toString().replaceAll(' ', '');
  var retval;
  var url = '?q=set:';
  url = url + id + '+' + name + '+cn:' + inputs.collector;

  try {
    var r = new sn_ws.RESTMessageV2('x_759224_magic_c_0.ScryFall API', 'Card GET');
    r.setStringParameterNoEscape('query', url);
    var response = r.execute();
    var httpStatus = response.getStatusCode();
  } catch (ex) {
    var message = ex.message;
  }
  var parsedResponse = JSON.parse(response.getBody());
if(inputs.foil != 'none'){
	if (inputs.foil.toString() == "foil") {
		retval = parsedResponse.data[0].prices.usd_foil;
	} else if (inputs.foil.toString() == "etched") {
    	retval = parsedResponse.data[0].prices.usd_etched;
  	}
else {
  	retval = parsedResponse.data[0].prices.usd;
}
}
outputs.price = retval;
})(inputs, outputs);

